  ,\n\t\"SubContractingPartner\",\n\t\"SubDplyImplementationPartnerName\",\n\t\"SubContractingContributedHours\"\
  ,\n\t\"SubContractingActive\"\n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SYS_ID\"\
  \ as \"SubDplySysID\",\n       \"U_NUMBER\" as \"SubDplyNumber\",\n       \"U_DEPLOYMENT_NUMBER\"\
  \ as \"DplySysID\",\n       \"DV_U_DEPLOYMENT_NUMBER\" as \"DplyNumber\",\n    \
  \   \"U_SUBCONTRACTING_PARTNER\" as \"SubContractingPartnerSysID\",\n       \"DV_U_SUBCONTRACTING_PARTNER\"\
  \ as \"SubContractingPartner\",\n       \"U_IMPLEMENTATION_PARTNER_NAME\" as \"\
  SubDplyImplementationPartnerName\",\n       \"U_CONTRIBUTED_HOURS\" as \"SubContractingContributedHours\"\
  ,\n       \"U_ACTIVE\" as \"SubContractingActive\"\nFROM \"RDS\".\"SURF\".\"U_PARTNER_DEPLOYMENT_SUBCONTRACTOR\"\
  ;"
